function Home() {
  const usuario = {
    usuario: "",
    senha: "",
  };

  const Autenticar = () => {
    axios.post(`http://localhost:8080/usuario/cadastro` + usuario);
  };

  return (
    <MantineProvider>
      <Box>
        <Card shadow={"1rem"} withBorder padding={"1rem"}>
          <TextInput></TextInput>
        </Card>
      </Box>
    </MantineProvider>
  );
}

export default Home;
